import React, { useState, useEffect, useRef } from "react";
import "./App.css";

const API_URL = "http://localhost:5005/webhooks/rest/webhook";

function App() {
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState("");
  const [isTyping, setIsTyping] = useState(false);
  const messagesEndRef = useRef(null);

  useEffect(() => {
    messagesEndRef.current?.scrollIntoView({ behavior: "smooth" });
  }, [messages]);

  useEffect(() => {
    const fetchGreeting = async () => {
      setTimeout(() => {
        setMessages([
          {
            sender: "bot",
            text: "Hello! I'm your AI Assistant powered by advanced language models. I'm here to help you with questions, tasks, and provide insights. How can I assist you today?",
          }
        ]);
      }, 1200);
    };

    fetchGreeting();
  }, []);

  const sendMessage = async () => {
    if (!input.trim()) return;

    const newMessages = [...messages, { sender: "user", text: input }];
    setMessages(newMessages);
    setInput("");
    setIsTyping(true);

    try {
      const res = await fetch(API_URL, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ sender: "user", message: input }),
      });
      const data = await res.json();
      const botReplies = data.map((d) => ({
        sender: "bot",
        text: d.text,
      }));

      setTimeout(() => {
        setMessages([...newMessages, ...botReplies]);
      }, 800);
    } catch (err) {
      setTimeout(() => {
        setMessages([
          ...newMessages,
          { sender: "bot", text: "I apologize, but I'm experiencing connection difficulties. Please check your network and try again." },
        ]);
      }, 800);
    } finally {
      setTimeout(() => {
        setIsTyping(false);
      }, 600);
    }
  };

  const handleKeyPress = (e) => {
    if (e.key === 'Enter' && !e.shiftKey) {
      e.preventDefault();
      sendMessage();
    }
  };

  return (
    <div className="chat-container">
      {/* Microsoft Copilot Style Header */}
      <div className="header">
        <div className="logo-section">
          <div className="logo">AI</div>
          <h1 className="title">Copilot</h1>
        </div>
        <div className="header-actions">
          <button className="action-button">New Chat</button>
          <button className="action-button">Settings</button>
          <button className="action-button">Help</button>
        </div>
      </div>

      {/* Main Chat Window */}
      <div className="chat-window">
        {messages.map((msg, index) => (
          <div 
            key={index} 
            className={`chat-bubble ${msg.sender}`}
            style={{ 
              animationDelay: `${index * 0.1}s`,
              opacity: 0,
              animation: `messageSlideIn 0.4s ease-out ${index * 0.1}s forwards`
            }}
          >
            {msg.text}
          </div>
        ))}

        {isTyping && (
          <div className="chat-bubble typing">
            <div className="copilot-avatar">AI</div>
            <span className="typing-text">Copilot is thinking</span>
            <div style={{display: 'flex', gap: '2px'}}>
              <span className="dot"></span>
              <span className="dot"></span>
              <span className="dot"></span>
            </div>
          </div>
        )}

        <div ref={messagesEndRef} />
      </div>

      {/* Microsoft Copilot Style Input */}
      <div className="chat-input-area">
        <div className="input-wrapper">
          <input
            type="text"
            value={input}
            onChange={(e) => setInput(e.target.value)}
            onKeyPress={handleKeyPress}
            placeholder="Ask me anything..."
            disabled={isTyping}
          />
        </div>
        <button 
          className="send-button"
          onClick={sendMessage} 
          disabled={isTyping || !input.trim()}
        >
          {isTyping ? 'Sending...' : 'Send'}
        </button>
      </div>
    </div>
  );
}

export default App;
